      if (id == 'btn-toc') {
        title = 'Table of Contents';
        contents = $('#sidebar-navigation').html();
      }
      if (id == 'btn-nav') {
        title = 'Navigation';
        contents = $('#nav-cook').html();
      }
      if (id == 'btn-menu') {
        title = 'Menu';
        contents = $('.navbar-right').html();
      }
      modal.find('.modal-body').html(contents);
